import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';


class StockList extends React.Component{
    render(){
        const {stockList}= this.props
        return(
            <TableContainer component={Paper}>
            <Table >
            <TableHead>
                <TableRow>
                <TableCell>Name</TableCell>
                <TableCell >Quantity</TableCell>
                <TableCell >Price</TableCell>
                <TableCell >Average Cost</TableCell>
                <TableCell >Market Value</TableCell>
                <TableCell >Book Cost</TableCell>
                <TableCell >Gain Cost</TableCell>

                </TableRow>
            </TableHead>
            <TableBody>
                {rows.map((row) => (
                <TableRow key={stockList.name}>
                    <TableCell>{stockList.quantity}</TableCell>
                    <TableCell >{stockList.price}</TableCell>
                    <TableCell >{stockList.avgCost}</TableCell>
                    <TableCell >{stockList.mktVal}</TableCell>
                    <TableCell>{stockList.bookCost}</TableCell>
                    <TableCell>{stockList.gainLoss}</TableCell>                    
                    <TableCell>{stockList.percentage}</TableCell>


                </TableRow>
                ))}
            </TableBody>
            </Table>
            </TableContainer>
        )
    }
}

export default StockList;
